@vicjgrey @Repsol @MyWaylet @TeslaParaTodos @slcuervo La energía se pierde como el agua en una manguera con agujeros.
De lo que pasa por el cargador a lo que llega a la batería hay muchas pérdidas y consumos. Entre un 5 y un 10% desaparece.
En cargas ineficientes a bajo amperaje las perdidas llegan al 15%.

